INSERT INTO `tb_tipocontrato` VALUES (1,'CAJERO','Contrato_Final','ACTIVO','2012-04-22','SISTEMAS',NULL,NULL,'  Efectuar cortsmente la cobranza a los clientes.   Dar atencin preferencial al cliente que viene a pagar.   Hacer firmar documentos vlidos por las salidas de dinero con cua1quier concepto.   Exigir firma autorizada en los egresos de caja.   Reportar diaria y adecuadamente los ingresos del da.   Eliminar  favores de cambios de sencillo a terceros ajenos a la empresa.   Exigir el reporte de cobranzas de crditos reportados con la firma del que cobra.   Exigir cheque certificado por compras al contado a los clientes de Municipalidades.   Verificar los cobros con cheque que correspondan al titular que aparece en la factura, casos excepcionales reportar a la Administracin.   Conciliar las emisiones de facturas y boletas con el total reportado de dinero, por ventas al contado.   Verificar la recepcin de billetes falsos y monedas falsas.   Romper o hacer agujeros en los billetes falsos.   No permitir el acceso a ninguna persona a su rea de trabajo.   Exigir identificacin plena del titular (DNI), que van a cobrar algn pago.   Rellenar adecuadamente los formatos que usa diariamente, referente a ingresos o egresos.   Reportar cualquier falla de seguridad en salvaguarda del dinero que posea en custodia.   Mantener cerrada el cajn donde guarda el efectivo, producto de las cobranzas.   En las rotaciones ente cajeros exigir y presentar un arqueo de caja, debidamente firmado por el que recibe, el que entrega y de un auditor (personal de contabilidad).   Fomentar el compaerismo, el trabajo en equipo y el debido respeto entre todo el personal de la tienda.   Presentar sus reclamos y sugerencias por escrito al jefe inmediato.   Informar de las actitudes sospechosas que se susciten en la tienda, que considere que afecta o pueda causar futuras prdidas de dinero.'),(2,'VENDEDOR','Contrato_Final','ACTIVO','2012-05-01','SISTEMAS',NULL,NULL,'  Mantener el orden y limpieza de las instalaciones de la tienda.   Mantener constantemente limpio los productos.   Atender con cortesa y eficiencia a los clientes.   Asesorar, demostrar y explicar utilidad del producto a los clientes que no  deciden que producto comprar.   Cuidar y mantener seguro la mercadera que se encuentra en exhibicin.   Sugerir y fomentar la compra de productos de alta rotacin.   Sugerir e informar al jefe inmediato con copia a la Gerencia, de los productos que tengan poca rotacin.   Sugerir promocin de productos lenta o nula rotacin.   Mantenerse informado e informar a su jefe inmediato, con copia a la Gerencia, de los precios de productos similares iguales que   comercializa la competencia.   Sugerir al jefe inmediato, con copia a la Gerencia, de los productos que los clientes quieren y no tenemos en stock.    No hacer comentarios externos sobre el nivel de ventas, el precio de los productos, las polticas de ventas y en general cualquier informacin que se maneje para los intereses de la empresa.   No hacer comentarios externos sobre la condicin fsica, mental o moral entre compaeros de trabajo.   Fomentar el compaerismo y trabajo en equipo.   Fomentar y sugerir reuniones permanentes de trabajo sobre formas de atender a los clientes y hacer constante campaa de presentacin de los productos, de acuerdo a los meses del ao.   Informar sobre los problemas que surgen en el sistema.   Sugerir mejoras en el manejo del sistema de ventas.'),(3,'SECRETARIA Y CAJERA','Contrato_Final','ACTIVO','2012-05-01','SISTEMAS',NULL,NULL,'- Recibir e informar asuntos que tenga que ver con el departamento correspondiente, para que todos estemos informados y desarrollar bien el trabajo asignado. - Mantener discrecin sobre todo lo que respecta a la empresa. - Hacer y recibir llamadas telefnicas para tener informado a los jefes de los compromisos y dems asuntos. - Obedecer y realizar instrucciones que te sean asignadas por t jefe inmediato. - Administrar y organizar el acervo documentario correspondiente al pago de obligaciones de la empresa. - Recepcionar toda la documentacin de facturas de proveedores que ingresa a la Empresa, para ingresar al flujo  de caja para su programacin de pago correspondiente. - Revisar y verificar el pago de la documentacin que se ha realizado en el da, Para  evitar pagos indebidos que ser responsabilidad de la tesorera.'),(4,'ENCARGADO DE SISTEMAS','Contrato_Final','ACTIVO','2012-05-01','SISTEMAS',NULL,NULL,'Mantener las computadoras operativas.  Mantener constantemente informado a los Jefes de Tienda como se puede arreglar los problemas que ocasionan el sistema por la congestin de red, y/o antena. Solucionar los problemas de reportes de caja, de las tiendas, cuando hacen facturaciones a manos y/o por error de sistema para el cuadre de sus cajas por cada tienda. Asesorar, ensear el manejo del sistema al personal nuevo de venta,  administracin para mejoras de la empresa.   Informar sobre los problemas que surgen en el sistema.  Sugerir mejoras en el manejo del sistema de ventas.'),(5,'JEFE DE ALMACEN','Contrato_Final','ACTIVO','2012-05-01','SISTEMAS',NULL,NULL,' Recepcionar la mercadera, verificando el buen estado presentacin coordinado con su jefe inmediato cuando requiera apoyo. -Ordenar la mercadera y efectuar las entregas.  Codificar, etiquetar y ordenar la mercadera y efectuar las entregas correspondientes a las tiendas.  Rotar las mercaderas  en exhibicin y sellar las cajas vacas mientras estn en exhibicin  Controlar que los registros de ingresos y salidas de mercaderas, se encuentren registrados debidamente el KARDEX del sistema mecanizado.   Efectuar y promover inventarios fsicos diarios, semanal, mensual o bimensual, de chequeo preventivo, de los productos de mayor movimiento y de los de mayor precio y conciliarlos con los sistemas, dando cuenta a su jefatura de las diferencias encontradas.   Mantener limpio las instalaciones de los almacenes, pasadizos, lugar de almacenaje y servicios higinicos.   Colaborar con la demostracin algn producto al cliente, sobre la utilidad del producto, calidad y durabilidad, cuando la situacin se amerite.   Mantener el ambiente del almacn exclusivamente accesible para ese fin, evitando el ingreso de personal no autorizado y velar por la seguridad de la mercadera bajo su responsabilidad.   De existir daos en la mercadera por mal manipuleo, informar al jefe de tienda, identificando al responsable del acto negligente.   Elaborar y hacer cumplir la relacin de turnos para aseo de los servicios higinicos.  Mantener las zonas de libre trnsito, libres y accesibles en casos de evacuaciones de emergencia, informar los vencimientos de los extinguidores.   Cumplir y hacer cumplir con el reglamento interno de la empresa.  Actualizar los BINCARD de mercadera.   Asumir las diferencias de inventario junto con los dems integrantes del almacn general. -Cumplir con las dems funciones afines que le asigne su jefe inmediato.'),(6,'ALMACENERO','Contrato_Final','ACTIVO','2012-05-01','SISTEMAS',NULL,NULL,'- Realizar la carga y descarga de mercaderas que ingresan y salen de los almacenes. - Verificar al detalle lo consignado en la factura o gua, teniendo en cuenta su estado de conservacin, peso y cantidad consignada por el transportista. - Codificar y etiquetar la mercadera recibida. - Apoyar al Jefe de Almacn en el de reparto de mercadera, hacia las tiendas de venta, de manera inmediata y en su totalidad. - Mantener limpio las instalaciones de los almacenes, pasadizos, lugar de almacenaje y servicios higinicos.   - Mantener las zonas de libre trnsito, libres y accesibles en casos de evacuaciones de emergencia, informar oportunamente los vencimientos de uso, de extinguidores. - Cumplir  el reglamento interno de la empresa. - Apoyar al Jefe de Almacn a mantener actualizado los BINCARD de mercadera. - Informar a su jefe inmediato qu mercadera llega faltante, deteriorado y con cual transportista. - Informar a su jefe inmediato de las mercaderas en mal estado.'),(7,'ASISTENTE ADMINISTRATIVO','Contrato_Final','ACTIVO','2012-05-01','SISTEMAS',NULL,NULL,'- Ordenar y procesar la documentacin que servir de fuente base para realizar los trmites de  reintegro tributario que realiza la empresa. - Coordinar con el Contador de la empresa los trmites a realizar para el reintegro tributario ante SUNAT. - Estar informndose permanentemente de nuevos productos que tienen el beneficio del reintegro tributario. - Las dems funciones que lo asigne sus jefes superiores. -Informar diariamente de las Gestiones de Reintegro efectuadas. -Informar diariamente de su ubicacin fuera de la empresa. -Realizar inventarios peridicos en los almacenes.');
