)
BEGIN


select
-- Datos Persona-------------------
p.int_idPersona,
p.str_codigo,
p.str_apePaterno,
p.str_apeMaterno,
p.str_nombres,
p.str_dni,
p.str_estado,
-- Datos Persona-------------------
