    in nroGuia varchar(11),
    in estado varchar(45),
    in localPartida varchar(45)

)
BEGIN

SELECT

`tb_guiaremision`.`int_idGuiaremision`,         -- 1
`tb_guiaremision`.`str_numeroGuia`,             -- 2   
`tb_guiaremision`.`dte_fechaEmision`,           -- 3
