        `tb_flujocaja`.`str_motivo`,
        `tb_flujocaja`.`str_estado`,
        `tb_flujocaja`.`str_usuarioCreador`,
        `tb_flujocaja`.`dte_fechaCreacion`
    )
VALUES(
    NULL,
    idLocal,
    idCaja,
    cantidadSoles,
    cantidadDolares,
    cantidadTotalSoles,
    cantidadDiferencia,
    motivo,
    estado,
    usuarioCreador,
    (SELECT NOW())
);
update tb_impresora set str_estado = 'ACTIVO' WHERE str_numeroSerie = select_numeroSerie;
