    int_idMedidaRotacion,
    str_usuarioCreador,
    dte_fechaCreacion,
    str_estado
)
VALUES (
    null,
    nombreProducto,
    descripcion,
    fabricante,
    reintegroTributario,
    idFamilia,
    idUnidadMedida,
    idMedidaRotacion,
    usuarioCreador,
    (select now()),
    estado
);





UPDATE
    `bdmatriz_desa`.`tb_producto`
SET
    str_codigoInterno = 
concat((select str_codigoFamilia from tb_familia where int_idFamilia = idFamilia and str_estado = 'ACTIVO'),
(SELECT SUBSTRING(str_nombreProducto, 1, 1)), last_insert_id())
WHERE
    int_idProducto = last_insert_id();

