CREATE DEFINER=`agente`@`%` PROCEDURE `sp_listarContratoXPersona`(
    IN empresa int,
    IN codigoPersona varchar(10),
    IN estado varchar(20)
)
BEGIN

SELECT
-- Datos Persona-------------------
p.int_idPersona,
p.str_codigo,
p.str_apePaterno,
p.str_apeMaterno,
p.str_nombres,
p.str_dni,
p.str_estado,
-- Datos Persona-------------------
-- ================================
-- datos contrato------------------
c.int_idContrato,
c.int_idPersona,
c.int_idTipoContrato,
c.int_idEmpresa,
c.dte_fechaInicial,
c.dte_fechaFinal,
c.dbl_sueldo,
c.str_estado,
-- datos contrato------------------
-- ================================
-- Datos Tipo Contrato------------
tc.int_idTipoContrato,
tc.str_tipoContrato,
tc.str_nombreReporte,
tc.str_estado,

-- Datos Tipo Contrato-------------
-- ================================
-- Datos de Empresa----------------
e.int_idEmpresa,
e.str_razonSocial,
e.str_ruc,
e.str_domicilioEmpresa,
e.str_representanteLegal,
e.str_dniRepresentante,
-- Datos de Empresa---------------


-- Datos agregado despues de la creacion
c.str_usuarioCreador


FROM
    tb_contrato c,
    tb_empresa e,
    tb_persona p,
    tb_tipocontrato tc
WHERE
    p.int_idPersona = c.int_idPersona and
    c.int_idTipoContrato = tc.int_idTipoContrato and
    e.int_idEmpresa = c.int_idEmpresa and

    e.int_idEmpresa = empresa and
    p.str_codigo = codigoPersona and
    c.str_estado = estado;

END ;;
