CREATE DEFINER=`agente`@`%` PROCEDURE `sp_listarOrdenCompra`(
    IN numeroOC VARCHAR(45),
    IN proveedor VARCHAR(45),
    IN transportista VARCHAR(45),
    IN viaTransporte VARCHAR(45),
    IN TipoObligacion VARCHAR(45)
)
BEGIN

SELECT
    `tb_ordencompra`.`int_idOrdenCompra`, -- 1
    `tb_ordencompra`.`int_idProveedor`, -- 2
    `tb_ordencompra`.`str_numeroOC`, -- 3
    `tb_ordencompra`.`int_idTransportista`, -- 4
    `tb_ordencompra`.`int_idAlmacen`, -- 5
    `tb_ordencompra`.`str_viaTransporte`, -- 6
    `tb_ordencompra`.`int_idTipoObligacion`, -- 7
    `tb_ordencompra`.`dbl_precioBruto`, -- 8
    `tb_ordencompra`.`dbl_precioTotal`, -- 9
    `tb_ordencompra`.`dbl_descuentoTotal`, -- 10
    `tb_ordencompra`.`dbl_valorVenta`, -- 11
    `tb_ordencompra`.`dbl_igv`, -- 12
    `tb_ordencompra`.`dbl_igvRecuperado`, -- 13
    `tb_ordencompra`.`dbl_peso`, -- 14
    `tb_ordencompra`.`str_fechaEntrega`, -- 15
    `tb_ordencompra`.`str_fechaValidez`, -- 16
    `tb_ordencompra`.`str_operacion`, -- 17
    `tb_ordencompra`.`str_estado`, -- 18
    
    `tb_proveedor`.`str_razonSocial`, -- 19
    `tb_proveedor`.`str_ruc`, -- 20
    `tb_proveedor`.`str_direccion`, -- 21
    `tb_proveedor`.`str_telefono`, -- 22

    (SELECT `tb_proveedor`.`str_razonSocial` FROM `bdmatriz_desa`.`tb_proveedor`
    WHERE `tb_proveedor`.`int_idProveedor` = `tb_ordencompra`.`int_idTransportista`), -- 23
    (SELECT `tb_proveedor`.`str_ruc` FROM `bdmatriz_desa`.`tb_proveedor`
    WHERE `tb_proveedor`.`int_idProveedor` = `tb_ordencompra`.`int_idTransportista`), -- 24
    (SELECT `tb_proveedor`.`str_direccion` FROM `bdmatriz_desa`.`tb_proveedor`
    WHERE `tb_proveedor`.`int_idProveedor` = `tb_ordencompra`.`int_idTransportista`), -- 25
    (SELECT `tb_proveedor`.`str_telefono` FROM `bdmatriz_desa`.`tb_proveedor`
    WHERE `tb_proveedor`.`int_idProveedor` = `tb_ordencompra`.`int_idTransportista`), -- 26
    
    `tb_locales`.`str_nombre`, -- 27
    `tb_tipoobligacion`.`str_nombreTO` -- 28
FROM
    `bdmatriz_desa`.`tb_ordencompra` INNER JOIN `bdmatriz_desa`.`tb_proveedor`
    ON `tb_ordencompra`.`int_idProveedor` = `tb_proveedor`.`int_idProveedor`
    
    INNER JOIN `bdmatriz_desa`.`tb_locales`
    ON `tb_ordencompra`.`int_idAlmacen` = `tb_locales`.`int_idLocal`
    
    INNER JOIN `bdmatriz_desa`.`tb_tipoobligacion`
    ON `tb_ordencompra`.`int_idTipoObligacion` = `tb_tipoobligacion`.`int_idTipoObligacion`
WHERE
    `tb_ordencompra`.`str_numeroOC` LIKE CONCAT('%', numeroOC, '%')
    AND `tb_ordencompra`.`int_idProveedor` LIKE CONCAT('%', proveedor, '%')
    AND `tb_ordencompra`.`int_idTransportista` LIKE CONCAT('%', transportista, '%')
    AND `tb_ordencompra`.`str_viaTransporte` LIKE CONCAT('%', viaTransporte, '%')
    AND `tb_ordencompra`.`int_idTipoObligacion` LIKE CONCAT('%', TipoObligacion, '%')
    AND (`tb_ordencompra`.`str_estado` = 'ACTIVO'
    OR `tb_ordencompra`.`str_estado` = 'PENDIENTE'
    OR `tb_ordencompra`.`str_estado` = 'CERRADO')
order by int_idOrdenCompra desc, str_estado asc;
END ;;
