CREATE DEFINER=`agente`@`%` PROCEDURE `sp_listarPPOCFCTodos`(
    IN idOrdenCompra INT
)
BEGIN

SELECT
    `tb_proveedorproductoordencompra`.`int_idProveedor`, -- 1
    `tb_proveedorproductoordencompra`.`int_idProducto`, -- 2
    `tb_proveedorproductoordencompra`.`int_idOrdenCompra`, -- 3
    `tb_proveedorproductoordencompra`.`dbl_cantidad`, -- 4
    `tb_proveedorproductoordencompra`.`dbl_precio`, -- 5
    `tb_proveedorproductoordencompra`.`dbl_descuento`, -- 6
    `tb_proveedorproductoordencompra`.`dbl_peso`, -- 7
    `tb_proveedorproductoordencompra`.`str_estado`, -- 8
    
    `tb_producto`.`str_codigoInterno`, -- 9
    `tb_producto`.`str_nombreProducto`, -- 10
    `tb_producto`.`str_fabricante`, -- 11
    `tb_producto`.`str_reintegroTributario`, -- 12
    
    `tb_proveedorproductoordencomprafacturacompra`.`int_idFacturaCompra`, -- 13
    `tb_proveedorproductoordencomprafacturacompra`.`dbl_cantidadRecibida`, -- 14
    `tb_proveedorproductoordencomprafacturacompra`.`str_numeroFactura`, -- 15
    `tb_proveedorproductoordencomprafacturacompra`.`int_idLocalRecibido`, -- 16
    `tb_proveedorproductoordencomprafacturacompra`.`str_fechaDocumento`, -- 17
    `tb_proveedorproductoordencomprafacturacompra`.`str_estado`, -- 18
    `tb_proveedorproductoordencomprafacturacompra`.`dbl_conformidadOK`, -- 19
    `tb_proveedorproductoordencomprafacturacompra`.`dbl_conformidadFallaProveedor`, -- 20
    `tb_proveedorproductoordencomprafacturacompra`.`dbl_conformidadFallaTransportista`, -- 21
    `tb_proveedorproductoordencomprafacturacompra`.`dbl_conformidadFallaOtro`, -- 22
    `tb_proveedorproductoordencomprafacturacompra`.`str_conformidadObservacion`, -- 23
    `tb_proveedorproductoordencomprafacturacompra`.`str_conformidadEstado` -- 24

   --  `tb_producto`.`int_idUnidadMedida`,
--     `tb_unidadmedida`.`str_nombreUM`
FROM
    `bdmatriz_desa`.`tb_proveedorproductoordencompra` INNER JOIN `bdmatriz_desa`.`tb_producto`
    ON `tb_proveedorproductoordencompra`.`int_idProducto` = `tb_producto`.`int_idProducto`
    INNER JOIN `bdmatriz_desa`.`tb_proveedorproductoordencomprafacturacompra`
    ON `tb_proveedorproductoordencompra`.`int_idProveedor` = `tb_proveedorproductoordencomprafacturacompra`.`int_idProveedor`
    AND `tb_proveedorproductoordencompra`.`int_idProducto` = `tb_proveedorproductoordencomprafacturacompra`.`int_idProducto`
    AND `tb_proveedorproductoordencompra`.`int_idOrdenCompra` = `tb_proveedorproductoordencomprafacturacompra`.`int_idOrdenCompra`
--     INNER JOIN `bdmatriz_desa`.`tb_unidadmedida` on `tb_unidadmedida`.`int_idUnidadMedida`=`tb_producto`.`int_idUnidadMedida`
WHERE
    `tb_proveedorproductoordencompra`.`int_idOrdenCompra` = idOrdenCompra
    AND `tb_proveedorproductoordencompra`.`str_estado` <> 'INACTIVO'
    AND `tb_proveedorproductoordencomprafacturacompra`.`str_estado` <> 'INACTIVO';

END ;;
