CREATE DEFINER=`agente`@`%` PROCEDURE `sp_listarPPUM`(
    IN estado VARCHAR(45)
)
BEGIN

SELECT
    `tb_proveedorproductounidadmedida`.`int_idProveedor`, -- 1
    `tb_proveedorproductounidadmedida`.`int_idProducto`, -- 2
    `tb_proveedorproductounidadmedida`.`int_idUnidadMedidaVenta`, -- 3
    `tb_proveedorproductounidadmedida`.`str_UnidadMedidaCompra`, -- 4 
    `tb_proveedorproductounidadmedida`.`dbl_costoCompra`, -- 5
    `tb_proveedorproductounidadmedida`.`dbl_unidadesContenidas`, -- 6
    `tb_proveedorproductounidadmedida`.`dbl_precioUnidadContenida`, -- 7
    `tb_proveedorproductounidadmedida`.`dbl_costoTraslado`, -- 8
    `tb_proveedorproductounidadmedida`.`dbl_precioFinal`, -- 9
    `tb_proveedorproductounidadmedida`.`str_estado`, -- 10
    
    `tb_proveedor`.`int_idProveedor`, -- 11
    `tb_proveedor`.`str_razonSocial`, -- 12
    `tb_proveedor`.`str_nombreComercial`, -- 13
    `tb_proveedor`.`str_ruc`, -- 14
    `tb_proveedor`.`str_direccion`, -- 15
    `tb_proveedor`.`str_email`, -- 16
    `tb_proveedor`.`str_telefono`, -- 17
    `tb_proveedor`.`str_fax`, -- 18
    `tb_proveedor`.`str_representanteLegal`, -- 19
    `tb_proveedor`.`str_banco`, -- 20
    `tb_proveedor`.`str_ctaPrincipal`, -- 21
    `tb_proveedor`.`str_ctaAlternativa`, -- 22
    `tb_proveedor`.`str_estado`, -- 23
    
    `tb_producto`.`int_idProducto`, -- 24
    `tb_producto`.`str_nombreProducto`, -- 25
    `tb_producto`.`str_codigoInterno`, -- 26
    `tb_producto`.`str_descripcion`, -- 27
    `tb_producto`.`str_fabricante`, -- 28
    `tb_producto`.`str_reintegroTributario`, -- 29
    `tb_producto`.`str_estado`, -- 30
    
    `tb_unidadmedida`.`str_codigoUM`, -- 31
