CREATE DEFINER=`agente`@`%` PROCEDURE `sp_listarProducto`(
    in str_codigoInter varchar(45),
	in str_nombreProd varchar(100),
    in int_familia varchar(45),
    in str_reintegro varchar(45),
    in int_rotacion varchar(45)
)
BEGIN

SELECT
    `tb_producto`.`int_idProducto`, -- 1
    `tb_producto`.`str_nombreProducto`, -- 2
    `tb_producto`.`str_codigoInterno`, -- 3
    `tb_producto`.`str_descripcion`, -- 4
    `tb_producto`.`str_fabricante`, -- 5
    `tb_producto`.`str_reintegroTributario`, -- 6
    `tb_producto`.`str_usuarioCreador`, -- 7
    `tb_producto`.`dte_fechaCreacion`, -- 8
    `tb_producto`.`str_usuarioModificador`, -- 9
    `tb_producto`.`dte_fechaModificacion`, -- 10

    `tb_familia`.`int_idFamilia`, -- 11
    `tb_familia`.`str_nombre`, -- 12
    
    `tb_unidadmedida`.`int_idUnidadMedida`, -- 13
    `tb_unidadmedida`.`str_nombreUM`, -- 14
    
    `tb_medidarotacion`.`int_idMedidaRotacion`, -- 15
    `tb_medidarotacion`.`str_nombreMR` -- 16
FROM
    `bdmatriz_desa`.`tb_producto` inner join `bdmatriz_desa`.`tb_familia`
    on `tb_familia`.`int_idFamilia` = `tb_producto`.`int_idFamilia`
    inner join `bdmatriz_desa`.`tb_unidadmedida`
    on `tb_unidadmedida`.`int_idUnidadMedida` = `tb_producto`.`int_idUnidadMedida`
    inner join `bdmatriz_desa`.`tb_medidarotacion`
    on `tb_medidarotacion`.`int_idMedidaRotacion` = `tb_producto`.`int_idMedidaRotacion`
where
     `tb_producto`.`str_codigoInterno` like concat('%',str_codigoInter,'%')
	AND `tb_producto`.`str_nombreProducto` like concat('%',str_nombreProd,'%')
	-- and `tb_producto`.`int_idFamilia` like concat('%',int_familia,'%')
	-- and `tb_producto`.`str_reintegroTributario` like concat('%',str_reintegro,'%')
	-- and `tb_producto`.`int_idMedidaRotacion` like concat('%',int_rotacion,'%')
ORDER BY
    `tb_producto`.`str_nombreProducto`;

END ;;
