CREATE DEFINER=`agente`@`%` PROCEDURE `sp_listarVenta`(
    IN idLocal VARCHAR(45),
    IN estado VARCHAR(45)
)
BEGIN

SELECT
    `tb_venta`.`int_idVenta`, -- 1
    `tb_venta`.`int_idProveedor`, -- 2
    `tb_venta`.`int_idProducto`, -- 3
    `tb_venta`.`int_idCliente`, -- 4
    `tb_venta`.`dbl_cantidad`, -- 5
    `tb_venta`.`dbl_precio`, -- 6
    SUM(`tb_venta`.`dbl_subTotal`) AS subTotal, -- 7
    SUM(`tb_venta`.`dbl_descuento`) AS descuento, -- 8
    SUM(`tb_venta`.`dbl_igv`) AS igv, -- 9
    SUM(`tb_venta`.`dbl_total`) AS total, -- 10
    `tb_venta`.`str_numeroDocumento`, -- 11
    `tb_venta`.`str_usuario`, -- 12
    `tb_venta`.`str_estado`, -- 13
    `tb_venta`.`str_clienteResponsable`, -- 14
    `tb_venta`.`int_local`, -- 15

    `tb_proveedor`.`str_razonSocial`, -- 16
    `tb_proveedor`.`str_nombreComercial`, -- 17
    -- `tb_venta`.`str_clienteResponsable`,
    -- `tb_venta`.`str_clienteResponsable`,
    `tb_proveedor`.`str_ruc`, -- 18
    `tb_proveedor`.`str_direccion`, -- 19
    `tb_proveedor`.`str_email`, -- 20
    `tb_proveedor`.`str_telefono`, -- 21
    `tb_proveedor`.`str_fax`, -- 22
    `tb_proveedor`.`str_representanteLegal`, -- 23
    `tb_proveedor`.`str_banco`, -- 24
    `tb_proveedor`.`str_ctaPrincipal`, -- 25
    `tb_proveedor`.`str_ctaAlternativa`, -- 26
    `tb_proveedor`.`str_estado`, -- 27

    `tb_producto`.`str_nombreProducto`, -- 28
    `tb_producto`.`str_codigoInterno`, -- 29
    `tb_producto`.`str_descripcion`, -- 30
    `tb_producto`.`str_fabricante`, -- 31
    `tb_producto`.`str_reintegroTributario`, -- 32
    `tb_producto`.`str_estado`, -- 33

    -- `tb_cliente`.`str_razonSocial`, -- 34
    `tb_venta`.`str_clienteResponsable`,
    `tb_cliente`.`str_rucdni`, -- 35
    `tb_cliente`.`str_direccion`, -- 36
    `tb_cliente`.`str_telefono`, -- 37
    `tb_cliente`.`str_estado`, -- 38

    `tb_locales`.`str_nombre`, -- 39
    `tb_locales`.`str_direccion`, -- 40
    `tb_locales`.`str_estado`, -- 41
    `tb_locales`.`str_telefono`, -- 42
    `tb_locales`.`str_distrito`, -- 43
    `tb_locales`.`str_provincia`, -- 44
    `tb_locales`.`str_departamento`, -- 45
    `tb_locales`.`str_codLocalGuia`, -- 46
    `tb_venta`.`dbl_unidadesContenidas` -- 47
FROM
    `bdmatriz_desa`.`tb_venta` INNER JOIN `bdmatriz_desa`.`tb_proveedor`
    ON `tb_venta`.`int_idProveedor` = `tb_proveedor`.`int_idProveedor`
    INNER JOIN `bdmatriz_desa`.`tb_producto`
    ON `tb_venta`.`int_idProducto` = `tb_producto`.`int_idProducto`
    INNER JOIN `bdmatriz_desa`.`tb_cliente`
    ON `tb_venta`.`int_idCliente` = `tb_cliente`.`int_idCliente`
    INNER JOIN `bdmatriz_desa`.`tb_locales`
    ON `tb_venta`.`int_local` = `tb_locales`.`int_idLocal`
WHERE
    `tb_venta`.`int_local` LIKE CONCAT('%', idLocal, '%')
    -- AND DATE(`tb_venta`.`str_fechaRegistro`) = DATE(NOW())
    AND `tb_venta`.`str_estado` = estado
    AND `tb_venta`.`str_numeroDocumento`LIKE 'TEMP-%'
GROUP BY
    `tb_venta`.`str_numeroDocumento`;

END ;;
