CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_renovarContrato`(
    IN idContrato int,
    IN idPersona int,
    IN idTipoContrato int,
    IN idEmpresa int,
    IN fechaInicial date,
    IN fechaFinal date,
    IN sueldo Double,
    IN estado varchar(45),    
    IN usuarioCreador varchar(45),
    IN fechaCreacion date,
    IN observacion text,
    IN estadoUpdate varchar(45)
)
BEGIN
-- Actualizamos el estado del contrato inicial-----------------------------
update tb_contrato set str_estado=estadoUpdate, str_observacion=observacion where int_idContrato=idContrato;
-- Insertamon el nuevo contrato---------------------------------------------
INSERT INTO `bdmatriz_desa`.`tb_contrato`
(`int_idContrato`,
`int_idPersona`,
`int_idTipoContrato`,
`int_idEmpresa`,
`dte_fechaInicial`,
`dte_fechaFinal`,
`dbl_sueldo`,
`str_estado`,
`dte_fechaCreacion`,
`str_usuarioCreador`,
`dte_ultimaModificacion`
-- `str_usuarioModificador`
)

VALUES
(
null,
idPersona,
idTipoContrato,
idEmpresa,
fechaInicial,
fechaFinal,
sueldo,
estado,
fechaCreacion,
usuarioCreador,
(select now())
-- ultimaModificacion,
-- usuarioModificador
);
END ;;
