CREATE DEFINER=`agente`@`%` PROCEDURE `sp_selectProveedorProducto`(
    in int_idProvee varchar(15),
    in int_idProd varchar(15),
    in str_esta varchar(45),
    IN nombreProducto VARCHAR(100)
)
BEGIN

SELECT
    `tb_proveedorproducto`.`int_idProveedor`, -- 1
    `tb_proveedorproducto`.`int_idProducto`, -- 2
    `tb_proveedorproducto`.`str_usuarioCreador`, -- 3
    `tb_proveedorproducto`.`dte_fechaCreacion`, -- 4
    `tb_proveedorproducto`.`str_modificarUsuario`, -- 5
    `tb_proveedorproducto`.`dte_fechaModificacion`, -- 6
    `tb_proveedorproducto`.`str_estado`, -- 7

    `tb_producto`.`str_nombreProducto`, -- 8
    `tb_producto`.`str_codigoInterno`, -- 9
    `tb_producto`.`str_descripcion`, -- 10
    `tb_producto`.`str_fabricante`, -- 11
    `tb_producto`.`str_reintegroTributario`, -- 12

    `tb_familia`.`int_idFamilia`, -- 13
    `tb_familia`.`str_nombre`, -- 14
    
    `tb_unidadmedida`.`int_idUnidadMedida`, -- 15
    `tb_unidadmedida`.`str_nombreUM`, -- 16
    
    `tb_medidarotacion`.`int_idMedidaRotacion`, -- 17
    `tb_medidarotacion`.`str_codigoMR`, -- 18
    `tb_medidarotacion`.`str_nombreMR`, -- 19
    `tb_medidarotacion`.`dbl_utilidad`, -- 20
    `tb_medidarotacion`.`dbl_adicional`, -- 21
    `tb_medidarotacion`.`str_estadoMR` -- 22
FROM
    `bdmatriz_desa`.`tb_proveedorproducto` inner join `bdmatriz_desa`.`tb_producto`
    on `tb_proveedorproducto`.`int_idProducto`=`tb_producto`.`int_idProducto`
    inner join `bdmatriz_desa`.`tb_familia`
    on `tb_familia`.`int_idFamilia` = `tb_producto`.`int_idFamilia`
    inner join `bdmatriz_desa`.`tb_unidadmedida`
    on `tb_unidadmedida`.`int_idUnidadMedida` = `tb_producto`.`int_idUnidadMedida`
    inner join `bdmatriz_desa`.`tb_medidarotacion`
    on `tb_medidarotacion`.`int_idMedidaRotacion` = `tb_producto`.`int_idMedidaRotacion`
where
    `tb_proveedorproducto`.`int_idProveedor` like int_idProvee
    and `tb_proveedorproducto`.`int_idProducto` like int_idProd
    and `tb_proveedorproducto`.`str_estado` = str_esta
    AND (`tb_producto`.`str_nombreProducto` LIKE CONCAT('%', nombreProducto, '%') or 
    `tb_producto`.`str_codigoInterno` = nombreProducto);

END ;;
