    hjc.int_idContrato = idContrato and
    (hjc.int_idJornada <> idJornada and hjc.int_idHorario <> idHorario);
    
    
SELECT
    *
    -- hjc.int_idHorario,
    -- hjc.int_idJornada,
    -- hjc.int_idContrato,
    -- hjc.str_estado

FROM
    tb_horariojornadacontrato hjc

WHERE
    hjc.int_idHorario = idHorario and
    hjc.int_idContrato = idContrato;

END ;;
